    {title:'maintenece', amount:25.6, date: new Date(2021, 7, 15)},
    {title:'morgage', amount:98.6, date: new Date(2021, 8, 15)},
  ]
  return (
    <div>
      <NewExpense/>
    <Expenses items={expense}/>
    </div>
  );
}

